import React from 'react';
import { Modal } from 'react-materialize';
import Admin from '../Admin';

function AdminModal(props) {
    return (
        <Modal id = 'admin-modal' header = 'Admin login' onClick = {props.onClick}>
            <Admin />
        </Modal>
    )
}

export default AdminModal;
